import React from 'react'
import './bloginput.css'

const BlogInput = ({ setContent, content }) => {
    return (

        <textarea className='blog-content' value={content} onChange={((e) => setContent(e.target.value))}>
        </textarea>
    )
}

export { BlogInput }
